socket.emit("join", 'user1');

function Example() {
  const [data, setData] = useState([]);

  useEffect(() => {
    async function fetchData() {
      const result = await fetch(`http://localhost:5000`);
      const body = await result.json();
      setData(body);
    }
    fetchData();
  }, []);

  return <div>      <tbody>
  <tr>
<th>FÃ¶rnamn</th>
<th>Efternamn</th> 
<th>Personnummer</th>
